import React, { useState, useEffect } from 'react';
import { FiPhone, FiArrowUp, FiArrowDown, FiAlertCircle } from 'react-icons/fi';

// Helper function to format date
const formatDate = (dateString) => {
  const date = new Date(dateString);
  return date.toLocaleDateString('en-US');
};

// Helper function to format time
const formatTime = (dateString) => {
  const date = new Date(dateString);
  return date.toLocaleTimeString('en-US', { hour: '2-digit', minute: '2-digit', hour12: true });
};

const CallLogPage = ({ darkMode }) => {
  const [callLogs, setCallLogs] = useState([]);

  // Fetch call logs from the server
  const fetchCallLogs = async () => {
    try {
      const response = await fetch('https://server-ou54.onrender.com/webapi/core/cdr');
      const data = await response.json();
      const sortedLogs = data.sort((a, b) => new Date(b.start_stamp) - new Date(a.start_stamp));
      setCallLogs(sortedLogs);
    } catch (error) {
      console.error('Error fetching call logs:', error);
    }
  };

  useEffect(() => {
    fetchCallLogs(); // Fetch call logs initially
    const interval = setInterval(fetchCallLogs, 5000); // Refresh call logs every 5 seconds
    return () => clearInterval(interval); // Cleanup on unmount
  }, []);

  return (
    <div
      className={`p-6 rounded-lg shadow-lg ${
        darkMode ? 'bg-gray-800 text-white' : 'bg-white text-gray-900'
      } transition-all`}
    >
      <h1 className="text-3xl font-bold mb-6 text-center">Call Log</h1>
      <div className="overflow-x-auto">
        <table className="min-w-full table-auto border-collapse border border-gray-300">
          <thead
            className={`${
              darkMode ? 'bg-gray-700 text-gray-300' : 'bg-gray-100 text-gray-700'
            }`}
          >
            <tr>
              <th className="py-4 px-6 text-left text-base font-semibold border-b border-gray-400">S.No.</th>
              <th className="py-4 px-6 text-left text-base font-semibold border-b border-gray-400">Caller</th>
              <th className="py-4 px-6 text-left text-base font-semibold border-b border-gray-400">Number</th>
              <th className="py-4 px-6 text-left text-base font-semibold border-b border-gray-400">Type</th>
              <th className="py-4 px-6 text-left text-base font-semibold border-b border-gray-400">Date</th>
              <th className="py-4 px-6 text-left text-base font-semibold border-b border-gray-400">Time</th>
              <th className="py-4 px-6 text-left text-base font-semibold border-b border-gray-400">Duration</th>
            </tr>
          </thead>
          <tbody>
            {callLogs.length > 0 ? (
              callLogs.map((log, index) => (
                <tr
                  key={log.serial_number || index}
                  className={`${
                    index % 2 === 0
                      ? darkMode
                        ? 'bg-gray-700'
                        : 'bg-gray-50'
                      : darkMode
                      ? 'bg-gray-600'
                      : 'bg-gray-200'
                  } hover:${
                    darkMode ? 'bg-gray-500' : 'bg-gray-300'
                  } transition-colors`}
                >
                  <td className="py-4 px-6 text-sm font-medium">{index + 1}</td>
                  <td className="py-4 px-6 text-sm font-medium">{log.caller_id_name || 'Unknown'}</td>
                  <td className="py-4 px-6 text-sm font-medium">{log.caller_id_number || 'N/A'}</td>
                  <td className="py-4 px-6 text-sm font-medium flex items-center space-x-2">
                    {log.call_direction === 'incoming' && (
                      <FiArrowDown className="text-green-500" title="Incoming Call" />
                    )}
                    {log.call_direction === 'outgoing' && (
                      <FiArrowUp className="text-blue-500" title="Outgoing Call" />
                    )}
                    {log.call_direction === 'missed' && (
                      <FiAlertCircle className="text-red-500" title="Missed Call" />
                    )}
                    <span className="capitalize">{log.call_direction || 'Unknown'}</span>
                  </td>
                  <td className="py-4 px-6 text-sm font-medium">{formatDate(log.start_stamp)}</td>
                  <td className="py-4 px-6 text-sm font-medium">{formatTime(log.start_stamp)}</td>
                  <td className="py-4 px-6 text-sm font-medium">
                    {Math.floor(log.duration / 60)}m {log.duration % 60}s
                  </td>
                </tr>
              ))
            ) : (
              <tr>
                <td
                  colSpan="7"
                  className="py-6 text-center text-lg font-medium text-gray-500"
                >
                  No call logs available.
                </td>
              </tr>
            )}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default CallLogPage;
